import {Link} from  "react-router-dom"
const Header = () => {
    return (
        <header>
            <a href="">
                <img src="" alt="" />
            </a>
            <nav className="nav">
                <ul className="nav__list">
                    <li className="nav__item">
                        <Link></Link>
                    </li>
                </ul>
            </nav>
        </header>
    );
};

export default Header;
